  false,\n\t\"url\": null,\n\t\"notes\": \"The Electronic Code of Federal Regulations
  (e-CFR) is the codification of the general and permanent rules published in the
  Federal Register by the executive departments and agencies of the Federal Government.
  It is divided into 50 titles that represent broad areas subject to Federal regulation.
  The Electronic Code of Federal Regulations is updated daily. The Electronic Code
  of Federal Regulations and its accompanying XML data is not yet an official format
  of the Code of Federal Regulations. Only the PDF and Text versions of the annual
  Code of Federal Regulations have legal status as parts of the official online format
  of the Code of Federal Regulations. The XML-structured files are derived from SGML-tagged
  data and printing codes, which may produce anomalies in display. In addition, the
  XML data does not yet include image files. Users who require a higher level of assurance
  may wish to consult the official version of the Code of Federal Regulations or the
  daily Federal Register on FDsys.gov.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
